import React, { Component } from "react";
import axios from "../../../axios";

export default class Dropdowns extends Component {
  constructor(props) {
    super(props);
    this.state = {
      options: []
    };
  }

  componentDidMount() {
    axios
      .get("api/values/selections/" + this.props.model)
      .then(response => {
        this.setState({
          options: response.data
        });
      })
      .catch(err => console.log(err));
  }
  render() {
    const options = Object.keys(this.state.options).map(el => {
        return <option key={el} value={el}>{this.state.options[el]}</option>
    })
    return options;
  }
}
